import React from 'react';

function Header() {
  return (
    <header>
      <h1>Estudio Comparativo: PostgreSQL vs MonetDB</h1>
      <p>Visualización de resultados de pruebas analíticas en almacén de datos dimensional</p>
    </header>
  );
}

export default Header;
